import Card from './components/Card';

function App() {
  const jokeElements = jokesdata.map((joke) => (
    <Jokes setup={joke.setup} punchline={joke.punchline} />
  ));
  const cardelem= datas.map((data)=>(
    <Card
    id={data.id}
    coverImg={data.coverImg}
    item={{ title: data.title, stats: { rating: data.stats.rating }, revcount: data.stats.revcount }}
    location={data.location}
    price={data.price}
    openspot={data.openspot}
  />


  ))

  return (
    <div className="App">
      <div> <img src="./img/air.png" width="180px"  className='img22'  /> </div>
      <div className='scrol'>
      {cardelem}

      </div>



    </div>
  );
}

export default App;
